from math import gcd
from itertools import combinations

def calculate_gifts(n, m, a, d):
    divisors = [a + i * d for i in range(5)]
    total_houses = m - n - 1
    ans = total_houses
    for i in range(1, 6):
        comb = list(combinations(divisors, i))
        for j in comb:
            lcm = j[0]
            for v in j[1:]:
                lcm = lcm * v // gcd(lcm, v)
            if i % 2 == 1:
                ans -= m // lcm - (n - 1) // lcm
            else:
                ans += m // lcm - (n - 1) // lcm
    return ans

